Entry.Value:
int gr=20;

/// <summary>
        /// Initialisierung
        /// </summary>
        public override void Init() {
            base.Init();
            // Hier kann z.B. pow oder gr aus den Einstellungen gelesen werden.
        }


        public override long InSet(double ar, double ai, double aj, double ak, double br, double bi, double bj, double bk, long zkl, bool invers) {


            double aar, aai, ai_alt, aj_alt, aaj, aak, cj, ck, ari, arj, ark, aik, aij, ajk, ak_alt;
            double c, d;
            long tw;
            int n;

            aar = ar * ar; aai = ai * ai; aaj = aj * aj; aak = ak * ak; tw = 0L;
            d = aar + aai + aaj + aak;
            for (n = 1; n < zkl; n++) {
                ak = 2 * ak * ar * aj + d * bk;
                ai = 2 * ai * ar * aj + d * bi;
                aj = aaj - (aai + aak + aar) / 2.0 + d * bj;
                ar = aar - (aai + aak + aaj) / 2.0 + d * br;
                aar = ar * ar; aai = ai * ai; aaj = aj * aj; aak = ak * ak;
                d = aar + aai + aaj + aak;
                if ((d) > gr) { tw = n; break; }
            }
            return (tw);

        }
